}</style>用途<br>
　一般養生用<br>
　建築・リフォーム作業用<br>
　橋梁の塗装養生用<br>
<br>
特長<br>
　P-カットテープ　NO.4100は、ピッと手で簡単に切れるポリエチレンクロス支持体で、コンパクトさをあわせもったテープです。<br>
　養生用のポリエチレンクロステープです。<br>
　手で簡単に切れ、糊残り性に優れ、安定した粘着特性を発揮します。<br>
　支持体強度が強いため、はがす際にテープが切れにくい。<br>
　厚みが薄くしなやかさもあるため、凹凸面になじみやすい。<br>
　テープの流れ（縦）方向もカットできる。<br>
　強い粘着力、かつ、長時間貼り付け後の糊残り
